import React from 'react'
import styled from 'styled-components'

const Cont = styled.div`

`
const Text = styled.h1`
  font-size: 20px;
font-weight: bold;
cursor: pointer;
margin-left: 5px;
color: ${props => props.isRed ? "red" : "black" };
  `

function Tahun(props) {
  return (
   <Cont>
     {
       props.showInfo ? (<Text isRed={props.teksTahun} >Tahun 2020</Text>) : null
     }
   </Cont>
  )
}

export default Tahun
